import axios from 'axios';
import {setLocations} from '../components/forAdmin/locationsTable';
export const proba = () => {
    console.log("evo me");
    axios.get('http://localhost:3005/proba').then(resp => {
        console.log(resp);
    });
}

export const getLocations = () => {
    console.log("evo me");
    axios.get('http://localhost:3005/getLocations').then(resp => {
        setLocations(resp);
    });
}

export const addLocation = (dataObject) => {
    console.log("Location added");
    axios.post('http://localhost:3005/admin/addlocation', dataObject).then(resp => {
        console.log(resp);
    });
}
